  [],\n\t\"revision_timestamp\": \"2016-08-04T08:18:40.402985\",\n\t\"name\": \"clarence-rhode-national-wildlife-range-and-nunivak-national-wildlife-refuge-narrative-r-31\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Clarence
  Rhode National Wildlife Range and Nunivak National Wildlife Refuge outlines Refuge
  accomplishments during the 1964 calendar year. The report begins by summarizing
  the weather conditions, habitat conditions, water conditions, and food and cover
  conditions during the year. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, rodents, and raptors- is also covered. The Refuge
  development and maintenance section discusses physical developments and collections
  and receipts. Resource management is outlined; topics include fur harvesting and
  commercial fishing. A progress report on field investigations and applied research
  is also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, hunting, and safety. Items of interest
  and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
